import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/Home.css'
const Home = () => {
  const navigate = useNavigate();

  return (
    <div className='navbar-container'>
    <nav className='navbar'>
      <a className='navbar-brand' href="#home">BOOKS</a>
      <div className='navbar-links'>
        <button className='navbar-button' onClick={() => navigate('/register')}>Register</button>
        <button className='navbar-button' onClick={() => navigate('/login')}>Login</button>
      </div>
    </nav>
    <section id="home" className='hero-section'>
      <h1 className='hero-title'>BOOKS REVIEW</h1>
      <p className='hero-subtitle'>Application</p>
    </section>
  </div>
  );
};

export default Home;
